scripts.electricGun_init:
var nullControl = ROYGBIV.createCustomControl({});
initializeReusableVectors();
handleDoorAnimations();
createFPSControl();
handleTexts();
handleMobileOrientationEvent();
if (ROYGBIV.isMobile() && !ROYGBIV.isOrientationLandscape()){
  ROYGBIV.changeScene("rotateDevice", onSceneRotateDeviceEntry);
}else{
  onScene1Entry();
}
ROYGBIV.stopScript("electricGun_init");

// *****************************************************************************
function initializeReusableVectors(){
  ROYGBIV.globals.reusableVector1 = ROYGBIV.vector();
  ROYGBIV.globals.reusableVector2 = ROYGBIV.vector();
}

function handleDoorAnimations(){
  var door1 = ROYGBIV.getObject("door1");
  var door2 = ROYGBIV.getObject("door2");
  var anim1 = "anim1";
  var openDoor = function(door){
    if (ROYGBIV.getAnimationState(door, anim1) == ANIMATION_STATE_NOT_RUNNING){
      ROYGBIV.startAnimation(door, anim1);
    }
    ROYGBIV.freezeAnimationOnFinish(door, anim1);
    ROYGBIV.cancelAnimationRewind(door, anim1);
  };
  var closeDoor = function(door){
    ROYGBIV.unfreezeAnimation(door, anim1);
    ROYGBIV.rewindAnimation(door, anim1);
  };
  ROYGBIV.onAreaEnter("area1", function(exitedAreaName){
    if (exitedAreaName != "area2"){
      openDoor(door1);
    }
    if (exitedAreaName != "area3"){
      openDoor(door2);
    }
  });
  ROYGBIV.onAreaExit("area1", function(enteredAreaName){
    if (enteredAreaName != "area2"){
      closeDoor(door1);
    }
    if (enteredAreaName != "area3"){
      closeDoor(door2);
    }
  });
  ROYGBIV.onAreaEnter("area2", function(exitedAreaName){
    if (exitedAreaName != "area1"){
      openDoor(door1);
    }
  });
  ROYGBIV.onAreaExit("area2", function(enteredAreaName){
    if (enteredAreaName != "area1"){
      closeDoor(door1);
    }
  });
  ROYGBIV.onAreaEnter("area3", function(exitedAreaName){
    if (exitedAreaName != "area1"){
      openDoor(door2);
    }
  });
  ROYGBIV.onAreaExit("area3", function(enteredAreaName){
    if (enteredAreaName != "area1"){
      closeDoor(door2);
    }
  });
}

function createFPSControl(){
  var lightning = ROYGBIV.getLightning("light1");
  var gun = ROYGBIV.getObject("gun");
  var anim1 = "anim1", anim2 = "anim2", anim3 = "anim3", anim4 = "anim4";
  var walls = "walls", wallsObj = ROYGBIV.getObject(walls);
  var initialPosition = ROYGBIV.vector();
  var box = "box";
  var boxes = [ROYGBIV.getObject("box1"), ROYGBIV.getObject("box2"), ROYGBIV.getObject("box3"), ROYGBIV.getObject("box4"), ROYGBIV.getObject("box5")];
  ROYGBIV.getMarkedPosition("pt1", initialPosition);
  ROYGBIV.globals.fpsControl = ROYGBIV.createFPSControl({
    playerBodyObject: ROYGBIV.getObject("playerBody"),
    initialPosition: initialPosition,
    requestFullScreen: false,
    speed: 350,
    jumpSpeed: 700,
    crosshairName: "ch1",
    shootableObjects: [ROYGBIV.getObject("box1"), ROYGBIV.getObject("box2"), ROYGBIV.getObject("box3"), ROYGBIV.getObject("box4"), ROYGBIV.getObject("box5")],
    weaponObject1: gun,
    onShoot: function(x, y, z, objName){
      if (objName == walls && ROYGBIV.getAnimationState(wallsObj, anim1) == ANIMATION_STATE_NOT_RUNNING){
        ROYGBIV.startAnimation(wallsObj, anim1);
      }else if (objName != walls){
        ROYGBIV.rewindAnimation(wallsObj, anim1);
      }
      if (objName && objName.startsWith("box")){
        var obj = ROYGBIV.getObject(objName);
        ROYGBIV.applyForce(ROYGBIV.getObject(objName), ROYGBIV.setVector(ROYGBIV.globals.reusableVector2, 500 * (Math.random() - 0.5), 500 * (Math.random() - 0.5), 500 * (Math.random() - 0.5)), ROYGBIV.setVector(ROYGBIV.globals.reusableVector1, x, y, z));
        if (ROYGBIV.getAnimationState(obj, anim1) == ANIMATION_STATE_NOT_RUNNING){
          ROYGBIV.startAnimation(obj, anim1);
          for (var i = 0; i<boxes.length; i++){
            if (boxes[i].name != objName){
              ROYGBIV.stopAnimation(boxes[i], anim1);
            }
          }
        }
      }else{
        for (var i = 0; i<boxes.length; i++){
          ROYGBIV.stopAnimation(boxes[i], anim1);
        }
      }
      ROYGBIV.setLightningEndPoint(lightning, ROYGBIV.setVector(ROYGBIV.globals.reusableVector1, x, y, z));
      ROYGBIV.startLightning(lightning);
      if (ROYGBIV.getAnimationState(gun, anim3) == ANIMATION_STATE_NOT_RUNNING){
        ROYGBIV.startAnimation(gun, anim3);
        ROYGBIV.startAnimation(gun, anim4);
        ROYGBIV.freezeAnimationOnFinish(gun, anim4);
      }
      var anim1State = ROYGBIV.getAnimationState(gun, anim1);
      if (anim1State == ANIMATION_STATE_NOT_RUNNING){
        ROYGBIV.startAnimation(gun, anim1);
        ROYGBIV.startAnimation(gun, anim2);
        ROYGBIV.freezeAnimationOnFinish(gun, anim1);
        ROYGBIV.freezeAnimationOnFinish(gun, anim2);
      }else if (anim1State == ANIMATION_STATE_REWINDING){
        ROYGBIV.cancelAnimationRewind(gun, anim1);
        ROYGBIV.cancelAnimationRewind(gun, anim2);
      }
    },
    onStoppedShooting: function(){
      ROYGBIV.stopLightning(lightning);
      ROYGBIV.stopAnimation(gun, anim3);
      ROYGBIV.rewindAnimation(gun, anim1);
      ROYGBIV.rewindAnimation(gun, anim2);
      ROYGBIV.unfreezeAnimation(gun, anim1);
      ROYGBIV.unfreezeAnimation(gun, anim2);
      ROYGBIV.unfreezeAnimation(gun, anim4);
      ROYGBIV.rewindAnimation(wallsObj, anim1);
      for (var i = 0; i<boxes.length; i++){
        ROYGBIV.stopAnimation(boxes[i], anim1);
      }
    }
  });
}

function activateFPSControl(){
  ROYGBIV.setActiveControl(ROYGBIV.globals.fpsControl);
}

function handleTexts(){
  var githubText = ROYGBIV.getText("github");
  var githubMobileText = ROYGBIV.getText("githubMobile");
  var controlsText = ROYGBIV.getText("controls");
  var controlsMobileText = ROYGBIV.getText("controlsMobile");
  var selectedGithubText, selectedControlsText;
  if (!ROYGBIV.isMobile()){
    ROYGBIV.hideText(controlsMobileText);
    ROYGBIV.hideText(githubMobileText);
    ROYGBIV.onTextMouseOver(githubText, function(){
      ROYGBIV.setTextColor(githubText, "orange");
    });
    ROYGBIV.onTextMouseOver(controlsText, function(){
      ROYGBIV.setTextColor(controlsText, "orange");
    });
    ROYGBIV.onTextMouseOut(githubText, function(){
      ROYGBIV.setTextColor(githubText, "lime");
    });
    ROYGBIV.onTextMouseOut(controlsText, function(){
      ROYGBIV.setTextColor(controlsText, "lime");
    });
    ROYGBIV.setTextColor(githubText, "lime");
    ROYGBIV.setTextColor(controlsText, "lime");
    selectedGithubText = githubText;
    selectedControlsText = controlsText;
  }else{
    ROYGBIV.hideText(githubText);
    ROYGBIV.hideText(controlsText);
    ROYGBIV.setTextColor(githubMobileText, "lime");
    ROYGBIV.setTextColor(controlsMobileText, "lime");
    selectedGithubText = githubMobileText;
    selectedControlsText = controlsMobileText;
  }
  ROYGBIV.onTextClick(selectedGithubText, function(){
    window.open('https://github.com/oguzeroglu/ROYGBIV', '_blank').location;
  });
  ROYGBIV.onTextClick(selectedControlsText, function(){
    if (!ROYGBIV.isMobile()){
      ROYGBIV.changeScene("controlsDesktop", onSceneControlsDesktopEntry);
    }else{
      ROYGBIV.changeScene("controlsMobile", onSceneControlsMobileEntry);
    }
  });
}

function handleMobileOrientationEvent(){
  if (!ROYGBIV.isMobile()){
    return;
  }
  ROYGBIV.setScreenOrientationChangeListener(function(isLandscape){
    if (isLandscape){
      ROYGBIV.changeScene("scene1", onScene1Entry);
    }else{
      ROYGBIV.changeScene("rotateDevice", onSceneRotateDeviceEntry);
    }
  });
}

// SCENE ENTRIES ***************************************************************
function onScene1Entry(){
  handleTexts();
  activateFPSControl();
}

function onSceneRotateDeviceEntry(){
  ROYGBIV.setActiveControl(nullControl);
  var text = ROYGBIV.getText("rotateDevice");
  ROYGBIV.setTextColor(text, "lime");
  ROYGBIV.startAnimation(text, "anim1");
}

function onSceneControlsDesktopEntry(){
  var backText = ROYGBIV.getText("controlDesktopBack");
  ROYGBIV.setTextColor(backText, "lime");
  ROYGBIV.setTextColor(ROYGBIV.getText("moveDesktop"), "orange");
  ROYGBIV.setTextColor(ROYGBIV.getText("jumpDesktop"), "orange");
  ROYGBIV.setTextColor(ROYGBIV.getText("lookDesktop"), "orange");
  ROYGBIV.setTextColor(ROYGBIV.getText("shootDesktop"), "orange");
  ROYGBIV.onTextMouseOver(backText, function(){
    ROYGBIV.setTextColor(backText, "orange");
  });
  ROYGBIV.onTextMouseOut(backText, function(){
    ROYGBIV.setTextColor(backText, "lime");
  });
  ROYGBIV.onTextClick(backText, function(){
    ROYGBIV.changeScene("scene1", onScene1Entry);
  });
}

function onSceneControlsMobileEntry(){
  var separator = ROYGBIV.getText("separator");
  var back = ROYGBIV.getText("controlsMobileBack");
  var move = ROYGBIV.getText("moveMobile");
  var look = ROYGBIV.getText("lookMobile");
  var jump = ROYGBIV.getText("jumpMobile");
  ROYGBIV.setTextColor(separator, "orange");
  ROYGBIV.setTextColor(back, "lime");
  ROYGBIV.setTextColor(look, "orange");
  ROYGBIV.setTextColor(jump, "orange");
  ROYGBIV.onTextClick(back, function(){
    ROYGBIV.changeScene("scene1", onScene1Entry);
  });
  ROYGBIV.setTextColor(move, "orange");
  ROYGBIV.onTextMouseOver(back, function(){
    ROYGBIV.setTextColor(back, "orange");
  });
  ROYGBIV.onTextMouseOut(back, function(){
    ROYGBIV.setTextColor(back, "lime");
  });
  ROYGBIV.hideText(back);
  ROYGBIV.hideText(move);
  ROYGBIV.hideText(look);
  ROYGBIV.hideText(jump);
  ROYGBIV.onAnimationFinished(separator, "anim1", function(){
    ROYGBIV.showText(back);
    ROYGBIV.showText(move);
    ROYGBIV.showText(look);
    ROYGBIV.showText(jump);
    ROYGBIV.startAnimation(move, "anim1");
    ROYGBIV.startAnimation(look, "anim1");
  });
  ROYGBIV.startAnimation(separator, "anim1");
}
